import React from 'react';
import Terminal, { TerminalOutput } from 'react-terminal-ui';
import './Garden.css';

function Garden({ moods }) {
  const lineData = moods.map((mood, index) => <TerminalOutput key={index}>{mood}</TerminalOutput>);

  return (
    <div className="garden">
      <Terminal name="Garden" colorMode="light">
        {lineData}
      </Terminal>
    </div>
  );
}

export default Garden;
